import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
  <div>
    <Head>
      <title>BitzPrice</title>
    </Head>
    <Navbar/>
    <div className="container">
      {props.children}
    </div>
  <style jsx global>
    {`
    .container {
          margin: 50px;
         
        }
        body {
    background-color: #3B1754;
  }
    `}
  </style>
  </div>
);

export default Layout;
